from datetime import datetime
from typing import List, Dict, Any

class User:
    def __init__(self, user_type: str):
        self.user_type = user_type

class Submission:
    def __init__(self, submission_id: int, data: Dict[str, Any], publish_status: str):
        self.submission_id = submission_id
        self.data = data
        self.publish_status = publish_status
        self.errors = []

    def update_publish_status(self, new_status: str):
        self.publish_status = new_status

class FABS:
    submissions: List[Submission] = []

    @classmethod
    def upload_submission(cls, submission: Submission):
        cls.submissions.append(submission)

    @classmethod
    def validate_submission(cls, submission: Submission):
        # Placeholder for validation logic
        if not submission.data.get('duns'):
            submission.errors.append("DUNS is required.")
        return len(submission.errors) == 0

    @classmethod
    def publish(cls, submission: Submission):
        if submission.publish_status != 'published':
            submission.update_publish_status('published')
            return f"Submission {submission.submission_id} published."
        return f"Submission {submission.submission_id} is already published."

class UI_Designer:
    @staticmethod
    def report_user_testing(agencies: List[str]):
        return f"User testing reported to agencies: {', '.join(agencies)}."

    @staticmethod
    def move_on_to_round_edits(page_type: str):
        return f"Moving to round 2 of {page_type} edits for approvals."

class Developer:
    @staticmethod
    def log_error(submission: Submission, error_message: str):
        submission.errors.append(error_message)

    @staticmethod
    def prevent_double_publish(submission: Submission):
        if submission.publish_status == 'published':
            return "Submission already published, cannot publish again."
        return "Submission can be published."

class DataUser:
    def process_deletions(self, date: str):
        return f"Processed deletions for date: {date}"

class AgencyUser:
    @staticmethod
    def request_file_format(file_type: str):
        return f"Requested {file_type} file format."

    @staticmethod
    def submit_data_elements(data_elements: List[str]):
        quoted_elements = [f'"{element}"' for element in data_elements]
        return f"Submitted data elements: {', '.join(quoted_elements)}"

def main():
    # Example usage
    user = User("FABS user")
    submission = Submission(1, {'duns': '123456789', 'data': 'sample'}, 'draft')

    # Upload and Validate Submission
    FABS.upload_submission(submission)
    if FABS.validate_submission(submission):
        print(FABS.publish(submission))
    else:
        print(f"Errors in submission: {submission.errors}")

    # UI Designer Tasks
    ui_designer = UI_Designer()
    print(ui_designer.report_user_testing(['Agency A', 'Agency B']))
    print(ui_designer.move_on_to_round_edits('Homepage'))

    # Developer Tasks
    developer = Developer()
    developer.log_error(submission, "Error with DUNS validation.")
    print(submission.errors)
    print(developer.prevent_double_publish(submission))

    # Data User Task
    data_user = DataUser()
    print(data_user.process_deletions("12-19-2017"))

    # Agency User Task
    agency_user = AgencyUser()
    print(agency_user.request_file_format("File F"))
    print(agency_user.submit_data_elements(["Element1", "Element2", "Element3"]))

if __name__ == "__main__":
    main()
